  static List<HymnsContent> list = [
    HymnsContent(id: 1916, position: 1, content: "Yesu Kristu wa pinduka, aleluya!\nOvangelo va tuluka, aleluya!\nTu wimbili ovisungo, aleluya!\nImbi, akuailu lene amanu, aleluya!", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_76, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1917, position: 2, content: "Ohuminyo ya telisua, aleluya!\nOwelema wa yuliwa, aleluya!\nYesu wa lembuisa okufa, aleluya!\nWa yovola imuenyo vietu, aleluya!", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_76, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1918, position: 3, content: "Vo lendela olivova, aleluya!\nUkuamuenyo wa lembuiwa, aleluya!\nOku sumua kuetu kua pua, aleluya!\nWa tu imula usumba wetu, aleluya!", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_76, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1919, position: 4, content: "Soma yetu wa yovoka, aleluya!\nWa pinduka lekemalo, aleluya!\nTuakuesetahãlo liaye, aleluya!\nElavoko lietu lia lua, aleluya!", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_76, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1920, position: 1, content: "Ovita via pua; uyaki wa imuha;\nOnjuli yetu ya linga Tõlo.\nTu imbili Suku esivayo.\nAleluya!", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_77, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1921, position: 2, content: "Ndaño olufa lua tamalãlã,\nOngusu yaluo wa yi pembula.\nEsanju lietu li yevale.\nAleluya!", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_77, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1922, position: 3, content: "Otembo yowelema ya pita.\nSoma yulamba wa tukuluka.\nEtumbangiyo ka li ka pue.\nAleluya!", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_77, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1923, position: 4, content: "Yesu wa tepa alienge onjembo,\nWa tu yuluila epito liomuenyo.\nVa sambiliye Onjovoli.\nAleluya!", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_77, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1924, position: 5, content: "Eyulo liaye lia tu yovola,\nLia nyola pe ongusu yokufa.\nTu imbi lesanju; tu sivayi.\nAleluya!", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_77, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1925, position: 1, content: "Yesu wa tundile kilu;\nWa silepo ulamba waye.\nWeya posi ha tu fila\nMekonda liombonde ya'e.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_78, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1926, content: "Yesu wa tu sola ciwa.\nWa sia ulamba waye, wa lisepuisa.\nWeya oku tu yovola\nMekonda liombonde yahe.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_78, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1927, position: 2, content: "Wa tu nyoñamela kuti.\nWa tu tulila omuenyo.\nNoke wa tu pindukila\nMekonda liombonde ya'e.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_78, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1928, position: 3, content: "Ndaño va tu yola epembe\nHaimo tu kolela Yesu.\nTuvilitumbike viaye\nTu kuama onjila ya'e.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_78, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1929, position: 1, content: "Eteke lina va kendele Yesu. \nOfeka yosi ya tekãva ca lua. \nEteke eli, Yesu wa pinduka \nUtanya wa tua kuosi koluali.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_79, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1930, content: "Vosi yoleli. Yoleli ya. \nSanjuki omo Yesu  \nWa tu imula okufa.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_79, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1931, position: 2, content: "Akãi va nyula eyambo loku lila; \nKa vo sangele, wa tundamo ale. \nWa pindukamo; eyambo lio tokoka. \nOkufa wa ku yula lomuenyo.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_79, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1932, position: 3, content: "Akuaku lila, ko ka sumui vali. \nUkuepinduko wa tu muisa eyovo. \nOmanu vosi vo wimbila ovaso \nVa mola eyulo lepinduko liaye.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_79, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1933, position: 1, content: "Ulamba wove,  \nA Njuli yokufa; \nWa yula onjembo;  \nWa yi yula olumue. \nUngelo wa loka  \nYu wopako ewe, \nEyambo lia siala  \nUpolokoso. \nUlamba wove,  \nA Njuli yokufa; \nWa yula onjembo  \nWa yi yula olumue.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_80, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1934, position: 2, content: "Uwale wove,  \nA Njuli yokufa;\nWa yula onjembo,  \nWa iyula olumue. \nWi imbili esivayo,  \nAmanu vosi, \nSambiliyi Soma  \nYene Ukuamuenyo. \nUwale wove,  \nA Njuli yokufa; \nWa yula onjembo  \nWa yi yula olumue.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_80, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1935, position: 3, content: "Usoma wove,  \nA Njuli yokufa; \nWa imula usumba  \nWosi wonjembo. \nTu linge olonjuli  \nNdomo Ove, a Ñala, \nTu yowuise Yordão  \nTa kimbo li kola. \nHa tu li sangi  \nL'Ove, a Njovoli, \nWa yula onjembo, \nWa yi yula olumue.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_80, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1936, position: 1, content: "Wa lala veyambo, \nYesu Upopeli. \nPuãi wa lalela ño \nEpinduko.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_81, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1937, content: "Yesu yu wa pinduka. \nEyambo ka lio telele puã. \nWa pinduka omo Onjuli yokufa, \nKuenje kilu Suku yu wo tambula. \nYesu yo! Yesu yo! \nAleluya! Yesu yo!", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_81, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1938, position: 2, content: "Va lava lutate, \nEyambo liaco. \nYesu wa li tuiya. \nWa tundamo.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_81, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1939, position: 3, content: "Ongusu yokufa, \nLeyi yeyambo. \nYesu wa vi nyõla \nWa pinduka.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_81, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1940, position: 4, content: "Unyãli wa piãla, \nOwo okufa; \nYesu wo lundula. \nTua yovoka.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_81, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1941, position: 1, content: "Ñala yetu wa pinduka, \nOnjembo ya yuliwa. \nWa lekisa unene waye. \nYesu, Cime comuenyo.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_82, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1942, content: "Wa pinduka. Aleluya. \nTu yoleli etali. \nTu sivayi lonjolela, \nYesu Kristu Onjovoli.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_82, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1943, position: 2, content: "Ñala yetu wa pinduka. \nSuku a sivayiwe. \nKowelema wokalunga \nYesu wa tundako ale.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_82, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1944, position: 3, content: "Ñala yetu wa pinduka, \nNdomo a ci popele. \nCilo wa tu livangela; \nWa tumãla kulamba.", hymnsNumber: UmHymnsNumberSeeder.EPINDUKO_LIA_YESU_82, typeStanza: HymnsContentCode.VERSE),
